     color: white;
`
const HeadTitle = styled.h1` 
     color:#46A358 ;
     font-family:'Franklin Gothic Medium', 'Arial Narrow', Arial, sans-serif;

`
const Titlecontainer =styled.div`
     margin: auto 0;
`
const Topcontainer = styled.div`

`
